sys_variable_value.value:
(function execute(inputs, outputs) {
  var grResus = new GlideRecord(CONST.RESUS);
  grResus.get(inputs.resus_sysid);

  if (new PDFGen().outputEventsToPDF(grResus)) {
    outputs.success = true;
  } else {
    outputs.success = false;
  }

})(inputs, outputs);

